import React from "react";
import * as userReducer from '../../../../redux/users/user.reducer';
import {useSelector} from "react-redux";

interface IProps{

}

interface IState  {
    users : userReducer.UserState
}

let UserProfile : React.FC<IProps> = () => {
    let userState : userReducer.UserState = useSelector((state : IState) => {
        return state.users
    })
    return(
        <React.Fragment>
            {/*<pre>{JSON.stringify(userState)}</pre>*/}
            <section className="mt-3">
                <div className="container">
                    <div className="row">
                        <div className="col-md-4">
                            <img src={userState.user.avatar} className="img-responsive img-thumbnail rounded-bottom"  alt=""/>
                        </div>
                    </div>
                </div>
            </section>
        </React.Fragment>
    )
}

export default UserProfile;
